package com.next.digip.model;

public class Contenedor {
	
	private String Numero;
	private int CantidadBulto;
	private String Observacion;
	private int Preparacion_Id;
	
	public Contenedor() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getNumero() {
		return Numero;
	}

	public void setNumero(String numero) {
		Numero = numero;
	}

	public int getCantidadBulto() {
		return CantidadBulto;
	}

	public void setCantidadBulto(int cantidadBulto) {
		CantidadBulto = cantidadBulto;
	}

	public String getObservacion() {
		return Observacion;
	}

	public void setObservacion(String observacion) {
		Observacion = observacion;
	}

	public int getPreparacion_Id() {
		return Preparacion_Id;
	}

	public void setPreparacion_Id(int preparacion_Id) {
		Preparacion_Id = preparacion_Id;
	}
	
	
	

}
